    false,nt"url": null,nt"notes": "Gridded bathymetry and IKONOS estimated
    depths of the shelf and slope environments of Maro Reef, Hawaii, USA. Bottom coverage
    was achieved in depths between 0 and 3000 meters. The ASCII includes multibeam bathymetry
    from the Simrad EM120, Simrad EM1002 Simrad EM300, Simrad EM3002d, and Reson 8101
    multibeam sonars collected as of October 2006 by the NOAA Coral Reef Ecosystem Division
    in depths between 20 and 5000 meters. The ASCII also includes estimated depths derived
    from high resolution IKONOS satellite imagery by the NOAA/NOS/NCCOS/CCMA Remote
    Sensing Team in shallow water between 0 and 16 meters.",nt"license_title":
